package fr.heriamc.proxy.listeners;

import java.util.List;
import java.util.concurrent.ThreadLocalRandom;

public enum OfflineModeSkin {

    SKIN1("",
            ""),

    SKIN2("",
            ""),

    SKIN3("",
            ""),

    SKIN4("",
            ""),

    SKIN5("",
            ""),

    SKIN6("",
            ""),

    SKIN7("",
            ""),

    ;

    private final String value;
    private final String signature;

    private static final List<OfflineModeSkin> allSkins = List.of(values());

    OfflineModeSkin(String value, String signature) {
        this.value = value;
        this.signature = signature;
    }

    public static OfflineModeSkin random(){
        ThreadLocalRandom current = ThreadLocalRandom.current();
        return allSkins.get(current.nextInt(allSkins.size()));
    }

    public String getValue() {
        return value;
    }

    public String getSignature() {
        return signature;
    }
}
